import { useState } from "react";

import Button from "../Button";
import style from "./AccountInfo.module.css";

import { AiFillEyeInvisible } from "react-icons/ai";
import { AiFillEye } from "react-icons/ai";

function AccountInfo(props) {
  const [visible, setVisible] = useState(true);

  function eyeClickHandler() {
    setVisible((prev) => !prev);
  }

  return (
    <div className={style["accountInfo__container"]}>
      <div className={style["accountInfo__first"]}>
        <h6>{props.title}</h6>
        <Button onClick={eyeClickHandler}>
          {<AiFillEye className={style.btn} />}
        </Button>
      </div>
      <div className={style["accountInfo"]}>
        <p>Income</p>
        <p>${props.income}</p>
      </div>
      <div className={style["accountInfo"]}>
        <p>Expense</p>
        <p>${props.expense}</p>
      </div>
      <div className={style["accountInfo"]}>
        <p>Net Income</p>
        <p>${props.net}</p>
      </div>
    </div>
  );
}

export default AccountInfo;
